import React from 'react';
import './App.css';
import HeroSection from './components/HeroSection';
import CardSection from './components/CardSection';
import Footer from './components/Footer';

function App() {
  return (
    <>
      <HeroSection />
      <CardSection />
      <Footer />
    </>
  );
}

export default App;
